INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1001, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, "春咲 ひより", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 1, 1.4, 1, "お！\nあそこに困ってそうな人発見！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1002, 0, "みんなみたいに\nわたしも強くならなきゃ", 0, "草野 優衣", "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 1, 1.4, 1, "大切な人を\n守れるようになりたい…って");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1003, 0, "フェンシングを始めてみては？", 0, "士条 怜", "少しは磨かれると思いますよ。", 0, 1, 1.4, 1, "キミに必要な集中力と感性が");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1004, 0, "ねぇ、にいちゃん！", 0, "穂高 みそぎ", "みそぎはねぇ、\nかくれんぼやりたい！", 0, 1, 1.5, 1, "今日はなにして遊ぶ？");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1006, 0, "風宮あかりです", 0, "風宮 あかり", "私といっしょに…\nいかない？", 0, 1, 1.4, 1, "ねぇ…");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1007, 0, "出雲宮子なのー", 0, "出雲 宮子", "食べ物の恨みは怖いのー", 0, 1, 1.5, 1, "プリンたべたいのー");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1008, 0, "ボクは虹村雪。", 0, "虹村 雪", "いいよ。\n見られることは運命さ…", 0, 1, 1.4, 1, "キミもボクの美貌に\n吸い寄せられたんだね。");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1009, 0, "フッ…聞いて後悔するがいい！", 0, "柊杏奈", "人呼んで「疾風の冥姫」!!", 0, 1, 1.4, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1010, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, "姫宮 真歩", "ほんまおおきにやわ～♪", 0, 1, 1.5, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1011, 0, "衣之咲璃乃です！", 0, "衣之咲 璃乃", "ここで会ったが\n100年目～！", 0, 1, 1.4, 1, "生き別れたお兄ちゃんを探して\n三千世界！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1012, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, "柏崎 初音", "…って、お願い！\n誰にも言わないでおいて～！", 0, 1, 1.4, 1, "ち、超能力って…\n何のことかな～？");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1016, 0, "ちょす！\n美波鈴奈だよ～♪", 0, "美波 鈴奈", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 1, 1.4, 1, "一応カリスマ読モJKやってまっす！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1017, 0, "はいたーい。\n喜屋武香織さー。", 0, "喜屋武 香織", "でも、沖縄もとってもいいとこさー", 0, 1, 1.4, 1, "東京は遊園地みたいなところさー");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1018, 0, "支倉伊緒です。", 0, "支倉 伊緒", "イオちゃんって呼んでね。", 0, 1, 1.4, 1, "先生って呼ばれるのは\nくすぐったいから");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1020, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, "茜 ミミ", "ミミをおいてかないでぇ～", 0, 1, 1.5, 1, "あ！/\お兄ちゃ～ん\nまってよ～");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1021, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, "栗林 くるみ", "ふぇぇぇぇぇん……", 0, 1, 1.5, 1, "あの……\nふぇ……");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1022, 0, "風宮よりです。\nあああああ！", 0, "風宮 より", "なんてありがとうございます！", 0, 1, 1.4, 1, "こんな私に貴重な時間を\n割いていただき、");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1023, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, "北条 綾音", "私こっち行きたいー\nね、早く早くー", 0, 1, 1.5, 1, "おにいちゃんどこいくの？\nえ？");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1025, 0, "わっ…わっ…私、\n天野すずめといいます！", 0, "天野 すずめ", "これて何か違う…\nあああすみません！", 0, 1, 1.4, 1, "ふ、不束者ですが\nどうぞ末永く…って、");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1027, 0, "……クスクス…私は\n…倉石恵理子……", 0, "倉石 恵理子", "離しませんわ………\n絶対に…!!", 0, 1, 1.4, 1, "あなたは…運命の……\n伴侶……");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1028, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, "佐々木 咲恋", "…そうでしょ？？", 0, 1, 1.4, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1029, 0, "桜井望だよ！\nよろしくねっ", 0, "桜井 望", "あはは、\n私もまだまだだなぁ～", 0, 1, 1.4, 1, "ぇっと…\nキミ、私のこと知らないの?!");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1030, 0, "デケデケデンっ！", 0, "ニノン・ジュベール", "ショーグン、\nワタシと一緒に天下統一デース！", 0, 1, 1.4, 1, "初めまして、\n私はニノン・ジュベール申すデス！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1031, 0, "上喜しのぶです。\n手元のドクロが父です。", 0, "上喜 しのぶ", "おかしいですね……", 0, 1, 1.4, 1, "でもって私の隣にいるのが……\nえ、見えない？");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1033, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, "野戸まひる", "そう、\nオラのボケに突っ込める相方が…！", 0, 1, 1.5, 1, "けんども\nそれには足りないモンが…");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1034, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, "綾瀬 ゆかり", "ちょ\nちょっと一杯飲んできます…！", 0, 1, 1.4, 1, "ちょっと緊張しちゃって…");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1036, 0, "氷川鏡華…です", 0, "氷川 鏡華", "これ以上お話しすることは…\nないです！", 0, 1, 1.5, 1, "知らない人とは話しちゃいけないので");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1038, 0, "柏崎…栞です。", 0, "柏崎 栞", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 1, 1.4, 1, "……あ、アラーム。");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1040, 0, "ふ、双葉碧です。", 0, "双葉 碧", "野に咲く花が、\n唯一の話相手です。", 0, 1, 1.4, 1, "私、一人も友達がいなくて……");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1042, 0, "三角千歌です。", 0, "三角 千歌", "そう思っています。", 0, 1, 1.4, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1043, 0, "安芸真琴だ。", 0, "安芸 真琴", "う、疑ってすまなかったな…", 0, 1, 1.4, 1, "あぁ？\nお前のそいつの仲間か？");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1044, 0, "わらわこそは夜を総べる者！", 0, "イリヤ・オーンスタイン", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 1, 1.4, 1, "生けとし生ける全ての者よ！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1045, 0, "そこで騎士は妖精を乱暴に……", 0, "遠見 空花", "ｌク、クウカに何かご用ですか!?", 0, 1, 1.4, 1, "ぐふふふふ……はっ！");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1046, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, "宮坂たまき", "う～ん…\n猫ってホントに最高にゃ～♪", 0, 1, 1.4, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1048, 0, "大神美冬よ！", 0, "大神 美冬", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 1, 1.4, 1, "それでは早速クエストに…");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1049, 0, "星野静流だよ！", 0, "星野静流", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 1, 1.4, 1, "クエストもバトルも\n掃除も洗濯も");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1050, 0, "アタシは玉泉美咲。", 0, "玉泉美咲", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 1, 1.5, 1, "見ての通りの\nセクシー美少女で");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1052, 0, "？？？", 0, "リマ", "？？？？", 0, 1, 1.4, 1, "？？？？");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1053, 0, "モニカ・ヴァイスヴィントだ。", 0, "モニカ・ヴァイスヴィント", "そ、そこまでいうなら\nもらってやる", 0, 1, 1.5, 1, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1058, 0, "モニカ・ヴァイスヴィントだ。", 0, "ペコリーヌ", "そ、そこまでいうなら\nもらってやる", 0, 1, 1.5, 1, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1059, 0, "モニカ・ヴァイスヴィントだ。", 0, "コッコロ", "そ、そこまでいうなら\nもらってやる", 0, 1, 1.5, 1, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_cd5738506ff1c4bfaf76efe58920d49d397919351981ab1e11573db9fdb7254a` VALUES (0, 2, 1, 0, 1060, 0, "モニカ・ヴァイスヴィントだ。", 0, "キャル", "そ、そこまでいうなら\nもらってやる", 0, 1, 1.5, 1, "菓子でつろうなどと\n稚拙な策を……");
